import React from 'react';
import './nav.css'

function nav() {
    return (
        <div className='navContainer'>
              <ul>
                    <li>Service</li>
                    <li>AboutUs</li>
                    <li>Our Work</li>
                    <li>Contact</li>
                 </ul>
             </div>
        
    );
}

export default nav;
